import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';

function App() {
  const handleLogin = () => {
    if (window.netlifyIdentity) {
      window.netlifyIdentity.open();
    } else {
      console.error('Netlify Identity not available');
    }
  };

  const handleSignup = () => {
    if (window.netlifyIdentity) {
      window.netlifyIdentity.open('signup'); // Open signup modal
    } else {
      console.error('Netlify Identity not available');
    }
  };

  return (
    <Router>
      <div className="App">
        <header className="App-header">
        </header>
        <div className="App-buttons">
          <button className="App-button" onClick={handleLogin}>Login</button>
          <button className="App-button" onClick={handleSignup}>Signup</button>
        </div>
        <Routes>
          {/* Routes for login and signup components */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
